import RemainingBudget from './RemainingBudget';
import SpentBudget from './SpentBudget';
import TotalBudget from './TotalBudget';

export const Budget = () => {
  return (
    <div className="row mt-3">
      <div className="col-sm">
        <TotalBudget />
      </div>
      <div className="col-sm">
        <RemainingBudget />
      </div>
      <div className="col-sm">
        <SpentBudget />
      </div>
      <h3 className="mt-3">Expenses</h3>
    </div>
  );
};
